<p id="message">前回は認証について学びましたね♪<br /><br />今回は認証を実現する技術について説明します。<br /><br />それでは、Let's shout!!</p>
<h2>認証技術</h2>
認証技術としては以下の5つを学びます。
<ul>
	<li>RADIUS</li>
	<li>TACACS/TACACS+</li>
	<li>Kerberos</li>
	<li>ディレクトリサービス</li>
	<li>EAP</li>
</ul>
いずれも基本的には「<span class="underline">AAA</span>」の3つの機能によって構成されます。
<ul>
	<li>A・・・認証(Authentication)</li>
	<li>A・・・認可(Authorization)</li>
	<li>A・・・課金(Accounting)</li>
</ul>
<span id="href_radius"></span>
<h2>RADIUS</h2>
「Remote Authentication Dial In User Service」の略で、ネットワーク上でユーザ認証を実現するプロトコルです。<br />IETFが標準化した認証技術です。<br /><br />RADIUSは、AAAモデルが確立される前に開発されたプロトコルであり、「認証と認可」が組み合わされており1つのサービスとして統合されて、「課金」のみ分離されています。
RADIUSでは「認証・認可」が1つのAccess-RequestやAccess-Acceptパケットに組み込まれています。
また、パスワードだけが暗号化されて通信されます。
<img src="../pics/radius.png" alt="RADIUS" />
従来のサーバが搭載しているRASシステムでは、ユーザからのアクセス要求を受けるアクセスサーバがユーザ認証を行う認証サーバを兼ねていましたが、これによって処理が複雑化するという問題がありました。<br /><br />RADIUSではユーザからのアクセス要求を受けるアクセスサーバとユーザ認証を行う認証サーバを分離させて、認証情報を集約させています。<br /><br />RADIUSの脆弱性は以下のとおりです。
<ul>
	<li>MD処理におけるBOFの危険性</li>
	<li>vendor-length検証の不十分であることに起因するDoSの危険性</li>
</ul>
「RADIUS」の進化系として「<a href="sc-1-1-23?to=href_diameter">Diameter</a>」があります。
<p>後ほど学習します。</p>
