			"TGT(チケット交付チケット)を受けたクライアントは各サービスへアクセスする度にTGT(チケット交付チケット)をTGS(チケット交付サーバ)に提示します。",
			"TGS(チケット交付サーバ)はTGT(チケット交付チケット)を持つクライアントに対して各サービスを利用するためのチケットを発行します。",
			"クライアントはTGS(チケット交付サーバ)から受け取ったチケットを使用してサーバに対してアクセス要求をします。",
			"サーバはチケットを持ったクライアントからのアクセス要求を受けてアクセスを許可します。",
		];
		document.getElementById("kerberos-button").addEventListener("click", () => {
			if (!x_lock) {
				x_lock = true;
				try {
					d[now - 1].style.fill = "none";
				} catch {}
				d[now].style.fill = "aqua";
				info.textContent = message[now];
				if (now !== message.length - 1) {
					setTimeout(() => {x_lock = false;}, 300);
				} else {
					setTimeout(() => {
						reset();
						x_lock = false;
						now = 0;
					}, 5000);
				}
				now++;
			}
		});
	})();
</script>
<h2>ディレクトリサービス</h2>
ユーザ認証に必要なID・パスワード・所属などの情報を一元管理して必要に応じてこれらを提供する仕組みを言います。<br /><br />実現するための仕組みとしては、<span class="underline">ディレクトリサーバ(LDAPサーバ)</span>がユーザ認証に関する情報を木構造で管理し、認証要求に対して応答します。<br /><br />LDAP(Lightweight Directory Access Protocol)と呼ばれるプロトコルがディレクトリサービスを実現するためのプロトコルとして良く用いられます。
<p>LDAPはITU-T勧告のX.500(DAP)を簡素化したものです。</p>
<span id="href_eap"></span>
<h2>EAP</h2>
「PPP Extensible Authentication Protocol」の略で、PPPの認証機能を拡張したユーザ認証用のプロトコルです。<br />EAPはIEEE 802.1Xを実装した標準的な認証プロトコルであり、無線LANのセキュリティプロトコルとして用いられています。
<div class="explanation">
	<div class="title">PPP</div>
	「Point to Point Protocol」の略で、2つのノード間においてデータリンク層(L2 / TCP/IP階層モデル)で通信するためのプロトコルです。
</div>
<div class="explanation">
	<div class="title">IEEE 802.1X</div>
	IEEEによって策定されたネットワーク環境においてユーザ認証を行うための規格です。<br /><br />詳しくはネットワークの授業で学びます。
	<p>リンクは<a href="ネットワークセキュリティ?to=href_l2-security">こちら</a>。</p>
</div>
EAPはアプリケーション層(Authentication層 / TLS・MD5・S/Key・etc...)とデータリンク層(無線LAN・PPP)をつなぐ層で動作します。<br /><br />EAPを無線LAN(IEEE 802.3 / IEEE 802.5 / IEEE 802.11x)上で動作させる際には<span class="underline">EAPOL(EAP over LAN)</span>を使用します。<br /><br />EAPがサポートしている認証方式は以下の通りです。
<div class="scroll-600w">
	<table>
		<tbody>
			<tr>
				<th>EAP-TLS</th>
				<td>サプリカント・サーバ間でTLSによる相互認証を行います。</td>
			</tr>
			<tr>
				<th>EAP-TTLS</th>
				<td>TLSの前の「T」はトンネル(Tunnel)の「T」です。<br />TLSによる認証後にEAPトンネルを確立して、そのトンネル内でサプリカントを様々な方法で認証します。</td>
			</tr>
			<tr>
				<th>PEAP</th>
				<td>「Protected EAP」の略で、EAP-TTLSに似ていますが、トンネル確立後のサプリカント認証はEAP準拠の方法に限られます。</td>
			</tr>
			<tr>
				<th>EAP-MD5</th>
				<td>MD5によるチャレンジレスポンス方式でパスワードを暗号化して、サプリカントの認証を行います。<br /><br />※認証サーバの正当性は確認されないため、無線LANでの使用は非推奨です。<br /><small>(偽のアクセスポイントを設置されたときにそこに接続されてしまい、通信内容を盗聴される危険性あり)</small></td>
			</tr>
		</tbody>
	</table>
</div>
<div class="explanation">
	<div class="title">サプリカント</div>
	ネットワーク上で行われる認証において、認証を要求する側(クライアント)を指します。
</div>
<div class="exam">
	&#9836;&#9836;&#9836; 令和元年秋試験午前&#8545;問16 &#9836;&#9836;&#9836;
	<div class="separator"></div>
	IEEE 802.1Xで使われるEAP-TLSが行う認証として、「<strong>ディジタル証明書による認証サーバとクライアントの相互認証</strong>」と説明しています。
</div>
<h2>SSO</h2>
SSOは認証技術ではありませんが、認証を維持する技術としてこの授業で扱うことにしますね♪<br /><br />SSOとは、「Single Sign On」の略で、認証を必要とするシステムにおいて一度認証に成功したらその情報を保持して次に認証が必要な時も認証プロセスを経ることなくサービスを利用できるようにする仕組みを言います。<br />SAMLはSOAPベースであるため、ドメインを超えて広く利用可能です。<br /><br />SSOを実現する技術には以下のものがあります。
<div class="scroll-600w">
	<table>
		<caption>SSOを実現する技術</caption>
		<tbody>
			<tr>
				<th>エージェント型SSO</th>
				<td>Cookieを用いて認証情報を保持します。<br /><br />以下の問題があります。
					<ul>
						<li>Cookieを用いるため同一ドメイン内でしかSSOを実現できない。</li>
						<li>各webサーバにエージェントをインストールする必要がある。</li>
					</ul>
				</td>
			</tr>
			<tr>
				<th>リバースプロキシ型SSO</th>
				<td>webサーバへのアクセスを認証サーバを兼ねたプロキシサーバ(リバースプロキシサーバ)が担当することで、認証情報を一元管理します。<br /><br />以下の問題があります。
					<ul>
						<li>認証サーバの負荷が大きくなる。</li>
						<li>ネットワークの構成上、ドメインをまたいだSSOの実現が困難。</li>
					</ul>
				</td>
			</tr>
			<tr>
				<th>SAML</th>
				<td>エージェント型SSO・リバースプロキシ型SSOの問題点を克服した次世代のSSO技術として注目されています。<br />以下で詳しく説明します。</td>
			</tr>
		</tbody>
	</table>
</div>
<div class="explanation">
	<div class="title">SAML</div>
	「Security Assertion Markup Language」の略で、OASISによって策定された認証情報を安全に交換するためのXMLの仕様です。
